import React, {useEffect, useState} from 'react';
import {View, Text} from 'react-native';
import {Test} from './ApplicationElements';
import applications from '../../dummyData/applications.json';

interface Props {
  restaurant: string;
}

const Application: React.FC<Props> = ({restaurant}) => {
  const [current, setCurrent] = useState('');

  useEffect(() => {
    applications.filter((a) => a.restaurant.label === restaurant);
    setCurrent(restaurant);
    console.debug(applications);
  }, [restaurant]);

  return <Text>{current}</Text>;
};

export default Application;
